Mongoose - projection with $elemMatch on nested fields<p>I'm relatively new to MongoDB/Mongoose and I've only performed simple queries. Now I'm having some trouble trying to filter my database in a slightly more complex way. I already did some research to tackle my previous issues, but now I can't move forward. Here's what happening:</p>
<p><strong>This is my schema:</strong></p>
<pre><code>const userSchema = new mongoose.Schema({
  email: String,
  password: String,
  movies: [
    {
      title: String,
      movieId: Number,
      view_count: Number,
      rating: Number,
      review: String,
    },
  ],
  lists: {
    watched_movies: [
      {
        title: String,
        director: String,
        genres: [{ type: String }],
        runtime: Number,
        date: Date,
      },
    ],
  },
});
</code></pre>
<p>I want to make a <code>GET</code> request that matches simultaneously <code>&quot;lists.watched_movies&quot;: { _id: req.params.entryId }</code> and also <code>&quot;movies.title&quot;: req.body.title</code> for a given <code>email</code>, so that the outcome of the <code>findOne</code> query would be just those elements and <strong>not</strong> the whole document. What I'm trying to accomplish is something like that:</p>
<pre><code>{
  email: &quot;some.email@gmail.com&quot;,
  movies: [
    {
      title: &quot;Mongoose Strikes Back&quot;,
      movieId: 123,
      view_count: 1,
      rating: 3,
      review: &quot;Very confusing movie!&quot;
    }
  ],
  lists: {
    watched_movies: [
      {
        _id: 4321
        title: &quot;Mongoose Strikes Back&quot;,
        director: &quot;Mongo&quot;,
        genres: [&quot;Drama&quot;],
        runtime: 150,
        date: &quot;2021-11-22&quot;
      }
    ]
  }
}
</code></pre>
<p>My first attempt to tackle it, however, wasn't successful. Here's what I tried:</p>
<pre><code>router.route(&quot;/:entryId&quot;).get((req, res) =&gt; {
  User.findOne(
    { email: &quot;some.email@gmail.com&quot; },
    {
      &quot;lists.watched_movies&quot;: { $elemMatch: { _id: req.params.entryId } },
      movies: { $elemMatch: { title: req.body.title } },
    },
    (err, entry) =&gt; {
      if (!err) {
        res.send(entry);
        console.log(entry);
      } else {
        console.log(err);
      }
    }
  );
});
</code></pre>
<p>It says that <code>Cannot use $elemMatch projection on a nested field</code>. I thought that maybe I can solve it by changing my schema, but I'd like to avoid it if possible.</p>

