Mongoose needs 2 times excecution to update collection<p>Something strange is going on or something idiotic I did but I got the following problem.</p>
<p>I got aenter code here web app where I have an online menu for a restaurant.</p>
<p>The structure of the products is as follows.</p>
<p>Facility-&gt;Category-&gt;Item-&gt;Name</p>
<p>So all item models have saved the name of the category they belong to as a string.</p>
<p>But sometimes you want to change the name of the category. What I wanted to do was find all the items in this category and change the name of the assigned category to the new one. Everything looked great until I saw that it took two times to run the controller that changed the name of the category and on the items to fully save the new name to the items.</p>
<p>The category changed the name but the items updated to the new name on the second run. Weird right?</p>
<p>So, what is that you can see that I don't and I implemented the silliest way of bugfix in the history of bugfixes.</p>
<p>Here is the controller - route.</p>
<pre><code>  module.exports.updateCtg = async(req,res)=&gt;{
    const {id} = req.params;

    for(i=0;i&lt;2; i++){
        category = await CategoryModel.findByIdAndUpdate(id,{...req.body.category});
        await category.save();
        items = await ItemModel.find({});
        for(item of items){
            if(item.facility === category.facility){
                item.category = category.name;
                await single.save();
            }
        }
    }
    res.render('dashboard/ctgview', {category._id});
}
</code></pre>

