pymongo: array comparison based on order<p>Example document:</p>
<pre><code>{ &quot;hash&quot;: [1, 2, 7] }
{ &quot;hash&quot;: [3, 2, 1] }
</code></pre>
<p>Given a hash array as input, of same size, I want to find the arrays that have the highest intersection, <strong>accounting for order</strong>.</p>
<p>So if the input is [1, 2, 3], then the first hash would have a score of 2, while the second would have a score of 1 (because only the second element matches the input's second element).</p>
<p>I know that for a normal intersection I can use</p>
<pre><code>arr = [1, 2, 3]
collection.aggregate([{
    &quot;$addFields&quot;: {
        &quot;weight&quot;: {
            &quot;$size&quot;: { &quot;$setIntersection&quot;: [ &quot;$hash&quot;, arr ] }
        }
    }
},
{ &quot;$sort&quot;: { &quot;weight&quot;: -1 } }])
</code></pre>
<p>But I'm stumped on comparing the order.</p>

