<p>I am completely new to MongoDB so my terminology might not be fully correct.</p>
<h2><strong>Context</strong></h2>
<p>I have some data with various dates in MongoDB and I am trying to use a <code>$switch</code> function to provide column aliasing to form some new calculated columns <em><strong>however</strong></em> I am running into some issues (perhaps syntax or wrong implementation) and want to know why and how to resolve.</p>
<h2>Question</h2>
<p>Basically I want to create a new calculated date column which takes the value of the a date field if its not null, else it takes the value of another date field if its not null and so on, however it defaults to some message <code>&quot;blank&quot;</code> if there is no values in any of those fields.</p>
<p><strong>Schema</strong></p>
<p>A single document with the collection follows this rough structure</p>
<pre><code>{
  _id:ObjectId(&quot;619756f12c115f24df503c26&quot;)
  uniqueid:&quot;12345678&quot;
  date1:&quot;2021-11-02 20:04:50.253&quot;
  date2:&quot;2021-11-03 18:10:57.520&quot;
  date3:&quot;2021-11-08 07:08:00.000&quot;
  date4:&quot;2021-11-08 14:40:00.000&quot;
  date5:&quot;2021-11-08 08:34:00.000&quot;
}
</code></pre>
<h2>Tried</h2>
<p>As part of an aggregation pipeline I tried using the <code>$project</code> and then returning all the columns along with the new calculated columns however it comes up with an error at this stage saying <code>stage must be a properly formatted document</code> leading me to believe I either my syntax is wrong or perhaps using the wrong operators to do this.</p>
<p>If I remove the calculated column code then the preview seems to work (further convincing me its something to do with my calculated column implementation).</p>
