            ],
            default: &quot;blank&quot;
          }
        },
      &quot;cal_date2&quot;: {
          $switch: {
            branches: [
                { case: {&quot;$date4&quot;: {$ne: null}}, then: &quot;$date4&quot;},
                { case: {&quot;$date5&quot;: {$ne: null}}, then: &quot;$date5&quot;}
            ],
            default: &quot;blank&quot;
          }
        },
       &quot;cal_date3&quot;: {
          $switch: {
            branches: [
                { case: {&quot;$date5&quot;: {$ne: null}}, then: &quot;$date5&quot;}
            ],
            default: &quot;blank&quot;
        }
      }
    }
}
])
</code></pre>
<p><strong>Update1: 2021-11-24 T12:15pm UTC</strong></p>
<p>I have added in a missing curly bracket at the end of each of the case expressions. The error now is <code>unknown operator: $date2</code></p>

